/* Function  structure for function  `filterInvalidDestNo` */

/*!50003 DROP FUNCTION IF EXISTS `filterInvalidDestNo` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `filterInvalidDestNo`(_smsid int) RETURNS text CHARSET latin1
    DETERMINISTIC
BEGIN
	declare invalidNoString text;
	UPDATE singleandbulksmsdetails SET STATUS="INVALID" WHERE smsid=_smsid AND (SUBSTR(destno,1, 5) NOT IN (SELECT prefix FROM rate) OR CHAR_LENGTH(destno) != 13);
	select group_concat(destno separator ', ') into invalidNoString from singleandbulksmsdetails where smsid=_smsid and status='INVALID';
	return invalidNoString;
END */$$
DELIMITER ;

/* Procedure structure for procedure `copy` */

/*!50003 DROP PROCEDURE IF EXISTS  `copy` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `copy`()
BEGIN
	DECLARE noMoreRow INT DEFAULT FALSE;
	DECLARE a INT;
	DECLARE d CHAR(16);
	DECLARE b, e DATE;
	DECLARE c TIME; 
	DECLARE nextRunDate DATE;  
	DECLARE message TEXT;
	DECLARE is_Active int;
	DECLARE cur1 CURSOR FOR SELECT campaignid,scheduledate,scheduletime,occursoption,enddate FROM campaignschedule;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET noMoreRow = TRUE;
	OPEN cur1;
	read_loop: LOOP
		FETCH cur1 INTO a, b, c, d, e;		
		IF noMoreRow THEN 
			LEAVE read_loop; 
		END IF;	
		SELECT isactive,msg INTO is_Active,message FROM campaign WHERE campaignid = a;
		SELECT a,b,c,d,e,is_Active,message;
		IF CURDATE() <= e and is_Active = 1 THEN
			IF b <= CURDATE() AND c <= CURTIME() THEN
				SELECT msg into message FROM campaign WHERE campaignid = a;
				BEGIN
					DECLARE destinationNo CHAR(13);
					DECLARE noMoreRow2 BOOLEAN DEFAULT FALSE;
					DECLARE cur2 CURSOR FOR SELECT destno FROM campaigndetails WHERE campaignid = a;
					DECLARE CONTINUE HANDLER FOR NOT FOUND SET noMoreRow2 = TRUE;
					OPEN cur2;
					read_loop2: LOOP
						FETCH cur2 INTO destinationNo;						
						IF noMoreRow2 THEN						
							LEAVE read_loop2;
						END IF;
						BEGIN
							INSERT INTO contentoutbox (MSISDN, SMSText) VALUES (destinationNo, message);
						END;
					END LOOP;
					CLOSE cur2;	
				END;
				if d = 1 then
					update campaign set isactive = 0 where campaignid = a;
				else 
					SELECT calcNextRunDate(b,d) into nextRunDate;
					select nextRunDate;
					IF nextRunDate <= e THEN 
						UPDATE campaignschedule SET scheduledate = nextRunDate WHERE campaignid = a;
					end if;	
				END IF;
			END IF;
		ELSE
			UPDATE campaign SET isactive = 0 WHERE campaignid = a;
		END IF;
	END LOOP;
	CLOSE cur1;
END */$$
DELIMITER ;

/* Procedure structure for procedure `LoadSingleBulkSMS` */

/*!50003 DROP PROCEDURE IF EXISTS  `LoadSingleBulkSMS` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `LoadSingleBulkSMS`()
BEGIN
	DECLARE noMoreRow1 INT DEFAULT FALSE;
	DECLARE _smsID INT;
	DECLARE _destinationNo CHAR(13);
	DECLARE cur1 CURSOR FOR SELECT smsid,destno FROM singleandbulksmsdetails WHERE singleandbulksmsdetails.status = 'QUE';
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET noMoreRow1 = TRUE;
	OPEN cur1;
	read_loop: LOOP
		FETCH cur1 INTO _smsID, _destinationNo;		
		IF noMoreRow1 THEN 
			LEAVE read_loop; 
		END IF;	
		BEGIN		
			declare _message text;
			declare _mask text;
			declare _transactionID text;
			DECLARE noMoreRow2 BOOLEAN DEFAULT FALSE;
			DECLARE cur2 CURSOR FOR SELECT msg, mask FROM singleandbulksms where smsid = _smsID;			
			DECLARE CONTINUE HANDLER FOR NOT FOUND SET noMoreRow2 = TRUE;
			OPEN cur2;
			read_loop2: LOOP
				FETCH cur2 INTO _message, _mask;
				IF noMoreRow2 THEN						
					LEAVE read_loop2;
				END IF;
				SELECT REPLACE(SUBSTR(UUID(),1,23),'-','') into _transactionID;
				INSERT INTO contentoutbox (MSISDN,ChannelID,SMSText,SMSMask,ActivationDate,DeactivationDate,Status,DeliveryTime,LastUpdate,TransactionID,RequestSource) 
				VALUES (_destinationNo,1,_message,_mask,now(),DATE_ADD(NOW(), INTERVAL 30 DAY),'QUEUED',NOW(),NOW(),_transactionID,'SILVERSTREET');
			
				update singleandbulksmsdetails set singleandbulksmsdetails.status = 'QUEUED' WHERE smsid =  _smsID and destno = _destinationNo;
			END LOOP;
			CLOSE cur2;	
		END;
	END LOOP;
	CLOSE cur1;
END */$$
DELIMITER ;

/* Procedure structure for procedure `test` */

/*!50003 DROP PROCEDURE IF EXISTS  `test` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `test`()
BEGIN
	DECLARE _destinationNo text;
	DECLARE noMoreRow INT DEFAULT FALSE;
	DECLARE cur1 CURSOR FOR SELECT parent.text FROM parent;
